import React from 'react';
import '../../App.css';
import BottomBar from '../BottomBar';

function Home() {
  const styles = {
    backgroundImage: "url('./logo512.png')",
    /* Additional background properties */
  };

  return (
    <div style={styles}>
      <h1>HEY</h1>
      <BottomBar />
    </div>
  );
}

export default Home;
